import{_ as a,c as e,o as t,b as r}from"./app.a754b1b5.js";var i="/docs-createproduct.gif",l="/ui-createproduct-material.png",n="/ui-createproduct-editproduct.png";const f=JSON.parse('{"title":"Skapa produkt","description":"","frontmatter":{},"headers":[{"level":2,"title":"Skapa produkt","slug":"skapa-produkt-1"},{"level":2,"title":"Material","slug":"material"},{"level":2,"title":"L\xE4gg till h\xE5llbarhetsinformation","slug":"lagg-till-hallbarhetsinformation"},{"level":3,"title":"Klimatp\xE5verkan","slug":"klimatpaverkan"},{"level":3,"title":"Cirkularitet","slug":"cirkularitet"},{"level":3,"title":"Material","slug":"material-1"},{"level":2,"title":"Tekniska egenskaper","slug":"tekniska-egenskaper"},{"level":2,"title":"SPARA","slug":"spara"}],"relativePath":"documentation/funktioner/skapa_produkt/index.md"}'),s={name:"documentation/funktioner/skapa_produkt/index.md"},d=r('<h1 id="skapa-produkt" tabindex="-1">Skapa produkt <a class="header-anchor" href="#skapa-produkt" aria-hidden="true">#</a></h1><p>Produkter \xE4r en av de viktigaste best\xE5ndsdelarna i Prodikt. Om du inte kan hitta en specifik produkt fr\xE5n en tillverkare eller en som \xE4r genererad fr\xE5n generisk data, d\xE5 kan du v\xE4lja skapa en egen produkt.</p><h2 id="skapa-produkt-1" tabindex="-1">Skapa produkt <a class="header-anchor" href="#skapa-produkt-1" aria-hidden="true">#</a></h2><p><img src="'+i+'" alt="Skapa produkt"></p><ol><li>Klicka p\xE5 \u201Dskapa produkt\u201D</li><li>V\xE4lj en bild genom att klicka p\xE5 kameraikonen.</li><li>Klicka p\xE5 V\xE4lj produktgrupp och s\xF6k efter den grupp som passar alternativt v\xE4lj fr\xE5n listan.</li><li>Skriv in tillverkare och v\xE4lj fr\xE5n listan. Du kan \xE4ven l\xE4gga till en egen genom att skriva namnet och trycka Enter.</li><li>Skriv in produktnamn (minst 5 tecken)</li><li>Du kan skriva in ett GTIN-nummer (GTIN (Global Trade Item Number) och artikelnummer.</li><li>Klicka till n\xE4sta steg.</li></ol><h2 id="material" tabindex="-1">Material <a class="header-anchor" href="#material" aria-hidden="true">#</a></h2><p>Alla produkter i Prodikt beh\xF6ver best\xE5 av minst ett material.</p><p><img src="'+l+'" alt="Material"></p><ol><li>Ge ditt material ett namn.</li><li>L\xE4gg till CAS-nummer om du \xF6nskar.</li><li>V\xE4lj den kategori som passar b\xE4st eller \xF6vrigt.</li><li>F\xF6r att kunna ber\xE4kna och g\xE5 vidare s\xE5 beh\xF6ver du ange vikt av materialet.</li><li>N\xE4r du lagt till de material som ing\xE5r i produkten s\xE5 g\xE5r du vidare.</li></ol><h2 id="lagg-till-hallbarhetsinformation" tabindex="-1">L\xE4gg till h\xE5llbarhetsinformation <a class="header-anchor" href="#lagg-till-hallbarhetsinformation" aria-hidden="true">#</a></h2><h3 id="klimatpaverkan" tabindex="-1">Klimatp\xE5verkan <a class="header-anchor" href="#klimatpaverkan" aria-hidden="true">#</a></h3><p><strong>EPD</strong></p><p>Koppla en befintlig EPD med specifik information genom att v\xE4lja i listan. Om EPD:n inkluderar mer \xE4n en produkt s\xE5 v\xE4ljer du alternativet som st\xE4mmer \xF6verens med produkten du skapar. Genom att v\xE4lja en befintlig EPD s\xE5 l\xE4ggs dess v\xE4rden automatiskt in och kopplas till produkten du skapar.</p><p><strong>Generisk data</strong></p><p>Du kan v\xE4lja att koppla generisk data till den produkt du skapar genom att v\xE4lja fr\xE5n en klimatdatabas som tillhandah\xE5ller generisk data.</p><p><strong>LCA</strong></p><p>\u{1F3D7}\uFE0F Under konstruktion</p><p><strong>CUSTOM</strong></p><p>Detta \xE4r f\xF6r dig som vill f\xE5 in ett eget v\xE4rde snabbt. \u26A0\uFE0F Observera att Custom-v\xE4rden inte f\xE5r anv\xE4ndas i exempelvis i en klimatdeklaration.</p><h3 id="cirkularitet" tabindex="-1">Cirkularitet <a class="header-anchor" href="#cirkularitet" aria-hidden="true">#</a></h3><p>H\xE4r fyller du i cirkularitetsegenskaper f\xF6r produkten.</p><h3 id="material-1" tabindex="-1">Material <a class="header-anchor" href="#material-1" aria-hidden="true">#</a></h3><p>H\xE4r fylls de h\xE4lsorelaterade v\xE4rdena f\xF6r inomhusmilj\xF6 i och anges i mikrogram per kubikmeter (\xB5g/m\xB3).</p><p><strong>BASTA</strong> Du kan \xE4ven s\xF6ka upp v\xE4rdena om produkten \xE4r kopplad till BASTAs databas.</p><h2 id="tekniska-egenskaper" tabindex="-1">Tekniska egenskaper <a class="header-anchor" href="#tekniska-egenskaper" aria-hidden="true">#</a></h2><p>H\xE4r fyller du i de tekniska egenskaperna som \xE4r baserat p\xE5 en valda produktgruppen. Ett exempel p\xE5 en golvprodukt \xE4r:</p><ul><li>Stegljudsd\xE4mpning - \u2206Lw</li><li>Ljudabsorption</li><li>Bruksklass</li></ul><h2 id="spara" tabindex="-1">SPARA <a class="header-anchor" href="#spara" aria-hidden="true">#</a></h2><p>N\xE4r du sparat i det sista steget s\xE5 l\xE4ggs produkten till i din produktsamling.</p><p>\u2699\uFE0F Du kan alltid redigera din produkt genom att klicka p\xE5 kugghjulet. <img src="'+n+'" alt="Spara och redigera"></p><div class="info custom-block"><p class="custom-block-title">\u2139\uFE0F Bra att veta</p><p>Det finns tre niv\xE5er av indelningen av produkter och system i Prodikt:</p><ul><li>Produktkategori - Exempel: Bygg och konstruktion <ul><li>Produktfamilj - Exempel: Yttertak <ul><li>Produktgrupp - Exempel: Pl\xE5ttak</li></ul></li></ul></li></ul></div>',31),p=[d];function o(k,u,m,g,h,c){return t(),e("div",null,p)}var b=a(s,[["render",o]]);export{f as __pageData,b as default};
